script: |
  super -f text -I q8664.spq | sort > q8664.out

inputs:
  - name: q8664.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT ( + 4 ) IS NOT NULL AND + col0 NOT BETWEEN - 55 * - col1 * + CAST ( NULL AS INTEGER ) + + col1 AND ( - 43 * + 8 );
  - name: tab2

outputs:
  - name: q8664.out
    data: |
